await robot.userRequest('参观公司');

await robot.goto('作品展示区');
await robot.detectHuman();
const visitChoice = await robot.ask('您是否需要参观公司？');

if(visitChoice == '需要'){
    const robotChoice = await robot.ask('您想先了解双臂机器人还是虚实结合机器人测试平台？');

    if(robotChoice == '双臂机器人'){
        await robot.speak('欢迎参观公司，这是我们的作品展示区，展示着我们研发的双臂机器人。');
        await robot.goto('创作室');
        await robot.speak('请继续跟我走');

    }else if(robotChoice == '虚实结合'){
        await robot.speak('欢迎参观公司，这是我们的创作室，我们正在开发虚实结合机器人测试平台。');
        await robot.goto('作品展示区');
        await robot.speak('请继续跟我走');
    }

    await robot.speak('本次参观结束');
    await robot.goto('充电桩');

}else{
    await robot.speak('好的，欢迎下次再来参观');
}

